    'oro_frontend_style_book.main_content.sub_title_main' => 'Oro StyleBook: UI Component Library',
    'oro_frontend_style_book.main_content.sub_title' => 'Oro UI Library Structure and Navigation',
    'oro_frontend_style_book.main_content.text_content' => 'The Oro UI Library is a display of the UI elements with their source code.',
    'oro_frontend_style_book.main_content.text_content_first' => 'Most of the UI elements that are involved in OroCommerce Management Console and Front Store UI, are included in the Oro UI Library and are grouped into categories (e.g. Form Elements, Grid Elements) tabbed at the top of the page.',
    'oro_frontend_style_book.main_content.text_content_second' => 'When on the Category tab, use the elements navigation tree (on the right) to jump to the element`s description, preview and code sample.',
    'oro_frontend_style_book.main_content.text_content_third' => 'The elements from the UI Library may be easily reused in your custom forms and pages in Oro application. You can also use the library as a preview of the updated styles when customizing the application look and feel (see <a href="https://github.com/orocommerce/orocommerce/tree/master/src/Oro/Bundle/FrontendBundle/Resources/doc/frontendStylesArchitecture.md">Oro Styles Architecture</a> and <a href="https://github.com/orocommerce/orocommerce/tree/master/src/Oro/Bundle/FrontendBundle/Resources/doc/howToAssetsCss.md">Styles Organization and Customization</a> for more information on the UI customization)',
    'oro_frontend_style_book.nav.title' => 'Elements',
    'oro_frontend_style_book.groups.forms.title' => 'Form Elements',
    'oro_frontend_style_book.groups.grid.title' => 'Grid Elements',
    'oro_frontend_style_book.groups.grid.text_content' => 'This section provides a preview and code sample for every UI element that is available out-of-the box in your Oro application.',
    'oro_frontend_style_book.groups.grid.text_content_first' => 'When UI and layout customization affects these elements, the preview dynamically updates after you refresh the page and clear the Oro application cache.',
    'oro_frontend_style_book.groups.grid.description_grids' => 'A grid or table may contain up to 12 columns. Every column is designed using <code class="language-html">&lt;div&gt;</code> element that takes proportional share of the screen in the desktop view and stretches to occupy the 100% width of the screen in mobile view. You can control relative width of the columns (like in 1/X) using <code class="language-html">grid__column--X</code> prefix. <br>The schematic wireframe samples below illustrate how OroCommerce with your active theme aligns the cells in the row and the text inside the cells depending on the number of the columns.',
    'oro_frontend_style_book.groups.grid.description_offset_row' => 'To control a spare space between the rows, you can use the <code class="language-html">grid_row--<offset-mode></code> class that modifies the bottom margin of the row container. Supported offset modes (and their default bottom margin) are <code class="language-html">--has-twin-row</code> (50px), <code class="language-html">--offset-l</code> (20px), <code class="language-html">--offset-m</code> (10px), <code class="language-html">--offset-s</code> (5px), <code class="language-html">--offset-none</code> (0px). The default offset for the <code class="language-html">grid__row</code> class is 15px, in between the <code class="language-html">--offset-l</code> and <code class="language-html">--offset-m</code>.',
    'oro_frontend_style_book.groups.grid.description_offset_columns' => 'A spare space between columns may be controlled using the <code class="language-html">grid_column--<offset-mode></code> class that modifies the right margin of the cell container. Supported offset modes are <code class="language-html">--offset-l</code> (20px), <code class="language-html">--offset-m</code> (10px), <code class="language-html">--offset-s</code> (5px). The default offset for the <code class="language-html">grid__column</code> class is 0px.',
    'oro_frontend_style_book.groups.grid.description_offset_columns_bottom' => 'The <code class="language-html">grid__column--offset-y</code> class modifies the bottom margin of the cell that is applied when the gird/table columns do not fit the screen width, and overflow to the next line (Default theme).',
    'oro_frontend_style_book.groups.grid.description_half' => 'To quickly design the layout (grid/table) with two equally sized columns, use the <code class="language-html">grid__column-half</code> class.',
    'oro_frontend_style_book.groups.grid.description_clear' => 'To forced the column to move to a new line, use the <code class="language-html">grid__column</code> with <code class="language-html">--both</code> prefix.',
    'oro_frontend_style_book.groups.grid.description_notification_flash_error' => 'The following code samples may be used to display notifications in a flash block. <br><br><strong>Error</strong>',
